import styled from "styled-components/native";
import { Image } from "react-native";

export const Container = styled.View``;

export const LogoImage = styled(Image)`
  width: 200;
  height: 200;
`;

export const LogoFull = styled(Image)`
  width: 135;
  height: 33;
`;
